import React, { Component } from 'react'

export class Footer extends Component {
  render() {
    return (
        <footer className='bg-body-tertiary'>
        <div className="text-center p-3">
            Design and Develop by Shivam Raval
        </div>
        </footer>
    )
  }
}

export default Footer
